import React, { Fragment, Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <Fragment>
        <h1>Hello from react</h1>
        <label htmlFor='Name'>Name</label>
      </Fragment>
    );
  }
}

export default App;
